import * as S from './CommentItem.style';

type CommentItemProps = {
  content: string;
  createAt: string;
};

function CommentItem({ content, createAt }: CommentItemProps) {
  return (
    <S.Container>
      <S.Update></S.Update>
      <S.Content></S.Content>
      <S.CreateAt>{createAt}</S.CreateAt>
    </S.Container>
  );
}

export default CommentItem;
